                //{cardInfo.then(cardInfo => cardInfo.map(renderCard))}
            </div>
            <div class="col-3">
               // {cardInfo.then(cardInfo => cardInfo.map(renderCard))}
            </div>
            <div class="col-3">
                //{cardInfo.then(cardInfo => cardInfo.map(renderCard))}
            </div>
        </section>
    );
}

export default Home;
